• Progressive House / EDM

• Release: Desde 2009, o produtor e DJ Bruno Braz, embala sempre as noites paulistanas com música eletrônica de qualidade, marcando presença em inúmeros festivais de pequeno e médio porte, bem como mostrando todo seu trabalho e presença de palco também em pequenas festas. Suas tracks, bootlegs, remixes e mashups, dispobinilizados na web, já foram ouvidos por todo o planeta e logo, ganhou notoriedade na cena eletrônica nacional como uma das revelações mais promissoras e influentes de sua época e vertente. 

Depois de uma parada de alguns anos focados única e exclusivamente em se aprimorar e ganhar cada vez mais experiência, atrelado ao gosto de sempre ser apaixonado por misturar quaisquer tipos de gêneros musicais e também a necessidade natural de se renovar, em 2015, criou um novo projeto, referindo-se agora como "BRAVER", focado essencialmente em um novo modelo e proposta de mostrar seu trabalho à todos.

(suas inspirações, espelhos e admiradores na música sempre foram os mais diversos. Passando por Benny Benassi, Gigi D'Agostino, DJ Antoine, Felguk, Deadmau5, David Guetta, Kaskade, Tommy Trash, Tiësto, Sharam, até os atuais Zedd, DVBBS, Martin Garrix, Avicii, Borgeous, Calvin Harris, Skrillex, Steve Aoki, Showtek, Carnage, Ummet Ozcan, FTampa, Galantis, KURA, Quintino, KSHMR e Tony Junior).



"NEVER GIVE UP <3" - BRAVER



(Bruno Mendes também é CEO e colunista do Portal Boomix, um site de entretenimento dedicado à música, games, cinema, literatura, moda, cultura geek, etc. Ele é colunista de música eletrônica e festivais e ali, expõe suas opiniões e comentários sobre o mundo da E-Music com matérias excusivas, além também de apresentar ali, toda sua arte e seu trabalho na música).

